description:
Wat bieden wij:
-Skirmishes (T6&8), teambattles en tournaments;
-Global map voor dumies;
-Uitkering van gold, ongeacht persoonlijk resultaat op de global map;
-Hoop gezelligheid;
-Mogelijkheid om van elkaar te leren

Wat bieden wij niet:
-Een unicumclan die alleen maar wint;
-TX battles omdat niet alle leden over TX beschikken en de 15v15 mode aanpassing financiële stelsel zou vragen;
-intensieve één-op-één coaching;
-enorme hoeveelheden gold en grote veroveringen op de global map, de clan speelt deze mode vooral om van te leren en voor de fun dus verwacht niet dat we hier altijd zullen winnen

Wat vragen wij van jou:
-Volwassen gedrag, maar we houden ook van een lolletje;
-Fatsoenlijk Nederlands taalgebruik, beheersing van het Engels*;
-Minimaal 1 T6 en 1 T8* CW tank;
-Minimaal een Tech tree t/m T8 gegrinded hebben*;
-Gebruik discord bij gezamelijke gevechten;
-Gebruik premiumrounds en consumables op de global map, niet verplicht bij Skirmishes etc;
-Teamplayer

* =bespreekbaar

Je moet om onze clan te mogen joinen;
minimaal 1 tier 8 tanks hebben en het liefst 1 van de volgende tier 6 tanks in je garage,
Cromwell (B), VK28.01, AMX 12 T, Type 64, A 43, Skoda T 25, STRV 74, T37, 59-16, Type 58;
je moet minimaal 16 jaar oud zijn;
je moet minimaal 1000 WN8 hebben;
hebben het liefst dat je ook teamspeak gebruikt.
----------------------------------------------------------------------------------------------------------------------------------------------------------------------
If you want to join our clan you need to have;
minimal 1 tier 8 tank and we would like that you have 1 of these tier 6 tanks in your garage,
Cromwell (B), VK28.01, AMX 12 T, Type 64, A43, Skoda T 25, STRV 74, T37, 59-16, Type 58;
a minimum age of 16 years old;
you need a WN8 of 1000 or higher;
we would appreciate the use of teamspeak.

Nous sommes un clan de joueurs motivés qui jouent désormais pour progresser et faire évoluer notre niveau de jeu afin de pouvoir atteindre un niveau correct pour se lancer dans les guerres de clans. Notre bastion est actuellement développé à son maximum, il nous faut donc simplement faire des escarmouches pour augmenter notre niveau de jeu et profiter des bonus du bastion.


Pour faire parti de notre clan, nous exigeons certains critères:
 - Une expérience minimale de 3000 batailles;
 - Un Wn8 minimal de 700;
 - Parler français;
 - Avoir au moins 18 ans et pouvoir jouer au moins trois soirs par semaine;
 - Avoir un Tier 6 (cromwell, t37 ) et un Tier 8 (IS-3, RU) afin de participer aux escarmouches;
 -Avoir l'esprit d'équipe et l'envie de gagner;
 



Si vous êtes volontaires, n'hésitez pas à nous contacter: (Commandant Kartoun et Commandant en second Dennisrodman911, ravageurtank, boulettepower).

Le Premier Régiment de Blindés Francophone vous souhaite un bon jeu :)

AmoredTiger
Pour faire partie de notre clan, les critères suivants sont exigés :
- Parler français ;
- Avoir une expérience minimale de 5000 batailles ;
- Être en mesure de jouer au moins quatres soir par semaine (15:00-22:00) ;
- Faire preuve en toute occasion d'un bon esprit d'équipe ;
- Disposer d'un casque et d'un micro ;
- Skype est recomandé ou ts3

En cas de volontariat, n'hésitez pas à contacter le Commandant ou les Commandants en Second.

*AmordeTiger* vous attend.

Wij accepteren elke Nederlander of Belg,
Daarmee behandelen we elk clanlid met respect en iedere speler is bijzonder
Kom dan bij onze clan: TheNLFighters [TNLF}
